import { programInitialState } from './initialState';

function programReducer(state = programInitialState.programs, action) {
  switch (action.type) {
    case 'SET_SELECTED_PROGRAM':
      return { ...state, ...action.payload };

    case 'ADD_PROGRAM':
    case 'UPDATE_PROGRAM':
    case 'UPDATE_PROGRAM_SUCCESS':
      console.log('Updating program in reducer:', action.payload);
      return {
        ...state,
        ...action.payload
      };

    case 'DELETE_PROGRAM':
      return programInitialState.program;

    default:
      return state;
  }
}

export { programReducer };
